    totalChoiceCount
  } = useSelector(state => ({
    users: state.users,
    user: state.user,
    pageIndex: state.pageIndex,
    hasUsersNotice: state.hasUsersNotice,
    choiceCount: state.choiceCount,
    totalUserCount: state.totalUserCount,
    totalChoiceCount: state.totalChoiceCount
  }));

